import React from "react";
function Main() {
  return (
    <div className="hero-wrapper">
      <div className="img-container"></div>
      <div className="main" id="about">
        <h1>Fast.</h1>
        <h1>Beautiful.</h1>
        <h1>Recipes.</h1>
      </div>
    </div>
  );
}

export default Main;
